from datetime import datetime
import os
import json

class SubmissionManager:
    def __init__(self):
        self.submissions = {}
        self.last_id = 0

    def delete_submissions_by_date(self, date):
        date = datetime.strptime(date, "%Y-%m-%d")
        self.submissions = {k: v for k, v in self.submissions.items() if v['date'] > date}

    def validate_submission(self, submission_data):
        required_fields = ['name', 'data']
        for field in required_fields:
            if field not in submission_data:
                return False, f'Missing required field: {field}'
        return True, 'Validation successful'

    def upload_fabs_file(self, file_path):
        if not os.path.exists(file_path):
            return False, 'File not found'
        with open(file_path, 'r') as file:
            data = json.load(file)
            submission_id = self.last_id + 1
            self.submissions[submission_id] = {'data': data, 'date': datetime.now(), 'status': 'uploaded'}
            self.last_id = submission_id
        return True, submission_id

    def check_submission_status(self, submission_id):
        return self.submissions.get(submission_id, 'Submission ID not found')['status']

    def update_submission(self, submission_id, new_data):
        if submission_id in self.submissions:
            self.submissions[submission_id]['data'] = new_data
            self.submissions[submission_id]['status'] = 'updated'
            return True, 'Submission updated successfully'
        return False, 'Submission ID not found'

